import React, { PureComponent } from 'react';
import { Div0 } from './style.js';
import { AreaChart, Area, XAxis, YAxis, CartesianGrid, Tooltip, ResponsiveContainer } from 'recharts';

const data = [
{
    name: '-3s',
    time: 12,
    num: 0,
    amt: 2400,
},
{
    name: '-2s',
    time: 16,
    num: 107.5,
    amt: 2210,
},
{
    name: '-1s',
    time: 19,
    num: 787,
    amt: 2290,
},
{
    name: '-1s',
    time: 20,
    num: 2500,
    amt: 2000,
},
{
    name: '1s',
    time: 23,
    num: 787,
    amt: 2181,
},
{
    name: '2s',
    time: 26,
    num: 107.5,
    amt: 2500,
},
{
    name: '3s',
    time: 32,
    num: 0,
    amt: 2100,
},
];

export default class DataDraw extends PureComponent {

render() {
    return (
    <Div0>
        <ResponsiveContainer width="100%" height="100%">
        <AreaChart
        width={700}
        height={400}
        data={data}
        margin={{
            top: 10,
            right: 30,
            left: 0,
            bottom: 0,
        }}
        >
        <CartesianGrid strokeDasharray="3 3" />
        <XAxis dataKey="name" />
        <YAxis />
        <Tooltip />
        <Area type="monotone" dataKey="num" stroke="#8884d8" fill="#01814A" />
        <Area type="monotone" dataKey="time" stackId="1" stroke="#82ca9d" fill="#82ca9d" />
        </AreaChart>
    </ResponsiveContainer>
    </Div0>
    );
}
}
